note_models.css:
.card 
{
  font-family: EPSON 教科書体Ｍ;
  font-size: 20px;
  text-align: left;
  color: black;
  background-color: white;
}

img {
  max-height: 144px;
}

.expression
{
  font-family: EPSON 教科書体Ｍ;
  font-size: 35px;
  color: #000000;
}

.reading
{
  font-family: 'MS PGothic';
  font-size: 24px;
  color: #AA0000;
}

.meaning
{
  font-family: Arial;
  font-size: 16px;
  color: #000000;
}

.sequence_marker
{
  font-family: Arial;
  font-size: 9px;
  color: #000000;
}

.media
{
  font-family: Arial;
  font-size: 12px;
  color: #000000;
}

[mtype=unknown]{
  color: red;
}
[mtype=seen] {
  color: orange;
}
[mtype=known]  {
  color: green;
}
[mtype=mature]{
 color:  #aeb6bf ;
}

tmpls.qfmt:
{{^Audio}}
<div style="text-align: left;"><span style="font-size: 40px; ">{{Context}}<br>{{furigana:Expression}}</span>
{{/Audio}}

{{#Audio}}
<div style="text-align: left;"><span style="font-size: 40px; ">{{Context}}{{Audio}}<br>
{{/Audio}}

tmpls.afmt:
{{#Reverse}}
{{FrontSide}}<hr id=answer><span style="font-size: 40px; ">{{furigana:Reading}}<br></span><span style="font-size: 26px;"><br><br>{{furigana:Meaning}}<br></span>
{{Audio}}
<br><br><span style="font-size: 26px;">{{hint:EnglishTL}}</span>

<span style="font-size: 40px;">
{{#MorphMan_FocusMorph}}<br>
MM:{{morphHighlight:MorphMan_FocusMorph}}
{{/MorphMan_FocusMorph}}
</span>
{{/Reverse}}
